import React from "react";
import { useDispatch} from "react-redux";
import { Link } from "react-router-dom";
import { clearFilters, clearSearch} from "../../redux/actions";
import { useHistory } from 'react-router-dom';
import logo from "../../images/favicon2.png";
import "./header.css"

const Header = () => {
  const dispatch = useDispatch();
  const history = useHistory();

  const handleClearSearchAndFilters = () => {
    dispatch(clearSearch());
    dispatch(clearFilters());
  };

  const handleHome = () => {
    dispatch(clearSearch());
    dispatch(clearFilters());
    history.push('/home');
  };

  const handleExit = () => {
    dispatch(clearSearch());
    dispatch(clearFilters());
    history.push('/');
  };

  return (
<header>
      <div className="header-container">
        <div className="header-left">
          <Link to="/home" onClick={handleClearSearchAndFilters}>
            <img src={logo} alt="Dog App Logo" />
            <h1>Dog App</h1>
          </Link>
        </div>
        <div className="header-right">
          <button onClick={handleHome} >Inicio</button>
          <button onClick={handleExit} >Salir</button>
        </div>
      </div>
    </header>
  );
};

export default Header;
